import styled from "styled-components";
import '../App.css';
import { Routes, Route, Link } from 'react-router-dom';

const HeaderContainer = styled.div`
  background-color: #A0CED9;
  width: 100%;
  display: flex;
  justify-content: space-around;
  p{
    margin: 15px;
    color: white;
    font-size: 20px;
    font-weight: normal;
  }
`

const PersonalArea = styled.div`
  background-color: #1F2041;
`

const Rules = styled.div`
  background-color: #1F2041;
`

const SignUpIn = styled.div`
  background-color: #1F2041;
`

const Header = () => {

  const Redirect = () => {
    <Link></Link>
  }

  return (
    <HeaderContainer>
      <PersonalArea>
        <p>Личный кабинет</p>
      </PersonalArea>
      <Rules>
        <p>Правила использования</p>
      </Rules>
        <SignUpIn onClick={Redirect}>
          <p>Регистрация/войти</p>
        </SignUpIn>
    </HeaderContainer>
  );
}

export default Header;
